package it.unicas.dpn.massdetectionservice.controller;

import com.fasterxml.jackson.core.type.TypeReference;
import com.fasterxml.jackson.databind.ObjectMapper;
import it.unicas.dpn.massdetectionservice.model.Prediction;
import it.unicas.dpn.massdetectionservice.service.TrainedNetwork;
import it.unicas.dpn.massdetectionservice.util.Utils;
import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.web.bind.annotation.*;
import java.io.IOException;
import java.util.HashMap;
import java.util.Map;

@RestController
@RequestMapping("/predict")
public class PredictionController {

    @Autowired
    TrainedNetwork model;

    @RequestMapping("/test")
    public String test() {
        return "Success";
    }

    @CrossOrigin(origins = "http://localhost:9000")
    @PostMapping(value="/mass")
    public Prediction predictMass(@RequestBody String data) throws IOException {
        Map<String, Object> map = Utils.parseJSON(data);
        //String imageCode = "";
        return model.doPrediction((String) map.get("imageData"));
    }
}
